import React from "react";

class Nextpage extends React.Component {
    onclick() {
        const btn: any = document.querySelector(".page-number")
        btn.classList.toggle("button-notice-active")
    }
    render() {
        return (
            <div className="row-nextpage">
                <div className="page-number" onClick={this.onclick}><p>◀</p></div>
                <div className="page-number"><p>1</p></div>
                <div className="page-number"><p>2</p></div>
                <div className="page-number"><p>3</p></div>
                <div className="page-number"><p>4</p></div>
                <div className="page-number"><p>5</p></div>
                <div className="page-number"><p>...</p></div>
                <div className="page-number"><p>10</p></div>
                <div className="page-number"><p>▶</p></div>
            </div>
        )
    }
}
export default Nextpage;
